import React from "react";
import Pion from './Pions';
import './style.css';

const Case = () => {

    return (
        <button className="rondCases" onClick={{
            background: Pion,
            get this() {
                return this._this;
            },
            set this(value) {
                this._this = value;
            },
        }}>
            <Pion />
            <Pion />
            <Pion />
            <Pion />
            <Pion />
        </button>
    )
}

export default Case;
